CREATE TABLE `location` (
  `id` int(255) NOT NULL AUTO_INCREMENT,
  `odp_name` varchar(255) DEFAULT NULL,
  `latitude` varchar(255) DEFAULT NULL,
  `longitude` varchar(255) DEFAULT NULL,
